Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "The attitude of impartiality, during a period of war, or with respect to future wars, adopted by third parties toward belligerents and recognized by the belligerents, which creates rights and duties between them.  Do not confuse with NON-ALIGNMENT", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Позиция беспристрастности в период войны или на случай будущих войн, которая занимается третьими сторонами по отношению к воюющим, признается воюющими и создает для тех и других взаимные права и обязанности. Не путать с \"Неприсоединением\"", language_id: (Language.find_by name: 'ru').id])
